import React, { useState, useEffect } from 'react';
import { Scissors, Database, FileText, Settings, History, Eye, Play, RotateCcw } from 'lucide-react';

// Configuration interface
interface Phase3Config {
  source_collection: string;
  cleaned_collection: string;
  batched_collection: string;
  database_name: string;
  batch_size: number;
  enable_ai_cleaning: boolean;
}

// Default configuration
const DEFAULT_CONFIG: Phase3Config = {
  source_collection: "normalized_statutes",
  cleaned_collection: "cleaned_statutes",
  batched_collection: "batched_statutes",
  database_name: "Statutes",
  batch_size: 10,
  enable_ai_cleaning: false
};

const Phase3: React.FC = () => {
  const [activeTab, setActiveTab] = useState('overview');
  const [config, setConfig] = useState<Phase3Config>(DEFAULT_CONFIG);
  const [isProcessing, setIsProcessing] = useState(false);
  const [status, setStatus] = useState<any>(null);
  const [statistics, setStatistics] = useState<any>(null);

  // Load config from localStorage on mount
  useEffect(() => {
    const savedConfig = localStorage.getItem('phase3_config');
    if (savedConfig) {
      try {
        setConfig(JSON.parse(savedConfig));
      } catch (error) {
        console.error('Error loading Phase 3 config:', error);
      }
    }
  }, []);

  // Save config to localStorage when it changes
  useEffect(() => {
    localStorage.setItem('phase3_config', JSON.stringify(config));
  }, [config]);

  // Update configuration
  const updateConfig = (updates: Partial<Phase3Config>) => {
    setConfig(prev => ({ ...prev, ...updates }));
  };

  // Reset configuration to defaults
  const resetConfig = () => {
    setConfig(DEFAULT_CONFIG);
  };

  // Fetch Phase 3 status
  const fetchStatus = async () => {
    try {
      const response = await fetch('/api/v1/phase3/status');
      if (response.ok) {
        const data = await response.json();
        setStatus(data);
      }
    } catch (error) {
      console.error('Error fetching Phase 3 status:', error);
    }
  };

  // Fetch statistics
  const fetchStatistics = async () => {
    try {
      const response = await fetch('/api/v1/phase3/statistics');
      if (response.ok) {
        const data = await response.json();
        setStatistics(data);
      }
    } catch (error) {
      console.error('Error fetching Phase 3 statistics:', error);
    }
  };

  // Start field cleaning
  const startFieldCleaning = async () => {
    setIsProcessing(true);
    try {
      const response = await fetch('/api/v1/phase3/start-field-cleaning', {
        method: 'POST',
        headers: { 'Content-Type': 'application/json' },
        body: JSON.stringify(config)
      });
      
      if (response.ok) {
        const result = await response.json();
        alert('Field cleaning started successfully!');
        fetchStatus();
      } else {
        const error = await response.json();
        alert(`Error starting field cleaning: ${error.detail}`);
      }
    } catch (error) {
      console.error('Error starting field cleaning:', error);
      alert('Failed to start field cleaning');
    } finally {
      setIsProcessing(false);
    }
  };

  // Start section splitting
  const startSectionSplitting = async () => {
    setIsProcessing(true);
    try {
      const response = await fetch('/api/v1/phase3/start-section-splitting', {
        method: 'POST',
        headers: { 'Content-Type': 'application/json' },
        body: JSON.stringify(config)
      });
      
      if (response.ok) {
        const result = await response.json();
        alert('Section splitting started successfully!');
        fetchStatus();
      } else {
        const error = await response.json();
        alert(`Error starting section splitting: ${error.detail}`);
      }
    } catch (error) {
      console.error('Error starting section splitting:', error);
      alert('Failed to start section splitting');
    } finally {
      setIsProcessing(false);
    }
  };

  // Rollback Phase 3
  const rollbackPhase3 = async () => {
    if (!window.confirm('Are you sure you want to rollback Phase 3? This will delete all cleaned and batched collections.')) {
      return;
    }

    try {
      const response = await fetch('/api/v1/phase3/rollback', {
        method: 'POST',
        headers: { 'Content-Type': 'application/json' },
        body: JSON.stringify(config)
      });
      
      if (response.ok) {
        const result = await response.json();
        alert('Phase 3 rollback completed successfully!');
        fetchStatus();
        fetchStatistics();
      } else {
        const error = await response.json();
        alert(`Error rolling back Phase 3: ${error.detail}`);
      }
    } catch (error) {
      console.error('Error rolling back Phase 3:', error);
      alert('Failed to rollback Phase 3');
    }
  };

  // Load data on mount
  useEffect(() => {
    fetchStatus();
    fetchStatistics();
  }, []);

  const tabs = [
    { id: 'overview', name: 'Overview', icon: Database },
    { id: 'field-cleaning', name: 'Field Cleaning', icon: Scissors },
    { id: 'section-splitting', name: 'Section Splitting', icon: FileText },
    { id: 'preview', name: 'Data Preview', icon: Eye },
    { id: 'statistics', name: 'Statistics', icon: Settings },
    { id: 'history', name: 'History', icon: History }
  ];

  return (
    <div className="space-y-0">
      {/* Header */}
      <div className="bg-white rounded-lg shadow-sm border border-gray-200 p-2">
        <h1 className="text-xl font-bold text-gray-900 mb-1">
          Phase 3: Field Cleaning & Splitting
        </h1>
        <p className="text-gray-600 text-sm">
          Clean normalized statutes and split into batches for processing
        </p>
      </div>

      {/* Current Configuration */}
      <div className="bg-white rounded-lg shadow-sm border border-gray-200 p-2 mt-2">
        <div className="flex items-center justify-between mb-2">
          <h2 className="text-lg font-semibold text-gray-900">Current Configuration</h2>
          <button
            onClick={resetConfig}
            className="inline-flex items-center px-3 py-1 border border-gray-300 text-sm font-medium rounded-md text-gray-700 bg-white hover:bg-gray-50 focus:outline-none focus:ring-2 focus:ring-offset-2 focus:ring-primary-500"
          >
            <RotateCcw className="h-4 w-4 mr-1" />
            Reset to Defaults
          </button>
        </div>
        <div className="grid grid-cols-2 md:grid-cols-4 gap-2 text-sm">
          <div>
            <span className="font-medium text-gray-700">Source:</span>
            <input
              type="text"
              value={config.source_collection}
              onChange={(e) => updateConfig({ source_collection: e.target.value })}
              className="ml-2 px-2 py-1 border border-gray-300 rounded text-xs w-full"
            />
          </div>
          <div>
            <span className="font-medium text-gray-700">Cleaned:</span>
            <input
              type="text"
              value={config.cleaned_collection}
              onChange={(e) => updateConfig({ cleaned_collection: e.target.value })}
              className="ml-2 px-2 py-1 border border-gray-300 rounded text-xs w-full"
            />
          </div>
          <div>
            <span className="font-medium text-gray-700">Batched:</span>
            <input
              type="text"
              value={config.batched_collection}
              onChange={(e) => updateConfig({ batched_collection: e.target.value })}
              className="ml-2 px-2 py-1 border border-gray-300 rounded text-xs w-full"
            />
          </div>
          <div>
            <span className="font-medium text-gray-700">Batch Size:</span>
            <input
              type="number"
              value={config.batch_size}
              onChange={(e) => updateConfig({ batch_size: parseInt(e.target.value) || 10 })}
              className="ml-2 px-2 py-1 border border-gray-300 rounded text-xs w-16"
              min="1"
              max="50"
            />
          </div>
        </div>
      </div>

      {/* Tab Navigation */}
      <div className="bg-white rounded-lg shadow-sm border border-gray-200">
        <nav className="flex space-x-8 px-4" aria-label="Tabs">
          {tabs.map((tab) => {
            const Icon = tab.icon;
            return (
              <button
                key={tab.id}
                onClick={() => setActiveTab(tab.id)}
                className={`py-3 px-1 border-b-2 font-medium text-sm flex items-center space-x-2 ${
                  activeTab === tab.id
                    ? 'border-purple-500 text-purple-600'
                    : 'border-transparent text-gray-500 hover:text-gray-700 hover:border-gray-300'
                }`}
              >
                <Icon className="h-4 w-4" />
                <span>{tab.name}</span>
              </button>
            );
          })}
        </nav>
      </div>

      {/* Tab Content */}
      <div className="bg-white rounded-lg shadow-sm border border-gray-200 p-4">
        {activeTab === 'overview' && (
          <div className="space-y-4">
            <div className="grid grid-cols-1 md:grid-cols-3 gap-4">
              <div className="bg-blue-50 p-4 rounded-lg">
                <h3 className="text-lg font-semibold text-blue-900 mb-2">Field Cleaning</h3>
                <p className="text-blue-700 text-sm mb-3">
                  Clean and validate normalized statutes, remove duplicates, and standardize field structure.
                </p>
                <button
                  onClick={startFieldCleaning}
                  disabled={isProcessing}
                  className="w-full bg-blue-600 text-white px-4 py-2 rounded-md hover:bg-blue-700 disabled:opacity-50 disabled:cursor-not-allowed"
                >
                  {isProcessing ? 'Processing...' : 'Start Field Cleaning'}
                </button>
              </div>

              <div className="bg-green-50 p-4 rounded-lg">
                <h3 className="text-lg font-semibold text-green-900 mb-2">Section Splitting</h3>
                <p className="text-green-700 text-sm mb-3">
                  Split cleaned statutes into batches for efficient processing and analysis.
                </p>
                <button
                  onClick={startSectionSplitting}
                  disabled={isProcessing}
                  className="w-full bg-green-600 text-white px-4 py-2 rounded-md hover:bg-green-700 disabled:opacity-50 disabled:cursor-not-allowed"
                >
                  {isProcessing ? 'Processing...' : 'Start Section Splitting'}
                </button>
              </div>

              <div className="bg-red-50 p-4 rounded-lg">
                <h3 className="text-lg font-semibold text-red-900 mb-2">Rollback</h3>
                <p className="text-red-700 text-sm mb-3">
                  Rollback Phase 3 changes and restore previous state if needed.
                </p>
                <button
                  onClick={rollbackPhase3}
                  className="w-full bg-red-600 text-white px-4 py-2 rounded-md hover:bg-red-700"
                >
                  Rollback Phase 3
                </button>
              </div>
            </div>

            {/* Status Overview */}
            {status && (
              <div className="bg-gray-50 p-4 rounded-lg">
                <h3 className="text-lg font-semibold text-gray-900 mb-3">Current Status</h3>
                <div className="grid grid-cols-1 md:grid-cols-3 gap-4">
                  <div className="text-center">
                    <div className="text-2xl font-bold text-blue-600">
                      {status.collection_status?.source_exists ? '✅' : '❌'}
                    </div>
                    <div className="text-sm text-gray-600">Source Collection</div>
                    <div className="text-xs text-gray-500">{config.source_collection}</div>
                  </div>
                  <div className="text-center">
                    <div className="text-2xl font-bold text-green-600">
                      {status.collection_status?.cleaned_exists ? '✅' : '❌'}
                    </div>
                    <div className="text-sm text-gray-600">Cleaned Collection</div>
                    <div className="text-xs text-gray-500">{config.cleaned_collection}</div>
                  </div>
                  <div className="text-center">
                    <div className="text-2xl font-bold text-purple-600">
                      {status.collection_status?.batched_exists ? '✅' : '❌'}
                    </div>
                    <div className="text-sm text-gray-600">Batched Collections</div>
                    <div className="text-xs text-gray-500">{config.batched_collection}_*</div>
                  </div>
                </div>
              </div>
            )}
          </div>
        )}

        {activeTab === 'field-cleaning' && (
          <div className="space-y-4">
            <h3 className="text-lg font-semibold text-gray-900">Field Cleaning Configuration</h3>
            <div className="bg-blue-50 p-4 rounded-lg">
              <h4 className="font-medium text-blue-900 mb-2">Field Cleaning Process</h4>
              <ul className="text-blue-700 text-sm space-y-1">
                <li>• Clean text fields by removing extra whitespace and normalizing</li>
                <li>• Validate Pakistan law using preamble analysis</li>
                <li>• Standardize document structure and field names</li>
                <li>• Remove special characters while preserving legal content</li>
                <li>• Add cleaning metadata and timestamps</li>
              </ul>
            </div>
            
            <div className="flex space-x-4">
              <button
                onClick={startFieldCleaning}
                disabled={isProcessing}
                className="bg-blue-600 text-white px-6 py-2 rounded-md hover:bg-blue-700 disabled:opacity-50 disabled:cursor-not-allowed"
              >
                {isProcessing ? 'Processing...' : 'Start Field Cleaning'}
              </button>
              <button
                onClick={fetchStatus}
                className="bg-gray-600 text-white px-6 py-2 rounded-md hover:bg-gray-700"
              >
                Refresh Status
              </button>
            </div>
          </div>
        )}

        {activeTab === 'section-splitting' && (
          <div className="space-y-4">
            <h3 className="text-lg font-semibold text-gray-900">Section Splitting Configuration</h3>
            <div className="bg-green-50 p-4 rounded-lg">
              <h4 className="font-medium text-green-900 mb-2">Section Splitting Process</h4>
              <ul className="text-green-700 text-sm space-y-1">
                <li>• Split cleaned statutes into {config.batch_size} equal batches</li>
                <li>• Analyze section content and metadata</li>
                <li>• Create separate collections for each batch</li>
                <li>• Optimize for parallel processing</li>
                <li>• Maintain data integrity across batches</li>
              </ul>
            </div>
            
            <div className="flex space-x-4">
              <button
                onClick={startSectionSplitting}
                disabled={isProcessing}
                className="bg-green-600 text-white px-6 py-2 rounded-md hover:bg-green-700 disabled:opacity-50 disabled:cursor-not-allowed"
              >
                {isProcessing ? 'Processing...' : 'Start Section Splitting'}
              </button>
              <button
                onClick={fetchStatus}
                className="bg-gray-600 text-white px-6 py-2 rounded-md hover:bg-gray-700"
              >
                Refresh Status
              </button>
            </div>
          </div>
        )}

        {activeTab === 'preview' && (
          <div className="space-y-4">
            <h3 className="text-lg font-semibold text-gray-900">Data Preview</h3>
            <div className="grid grid-cols-1 md:grid-cols-2 gap-4">
              <div className="bg-blue-50 p-4 rounded-lg">
                <h4 className="font-medium text-blue-900 mb-2">Cleaned Data Preview</h4>
                <p className="text-blue-700 text-sm mb-3">
                  Preview the cleaned statutes collection to verify field cleaning results.
                </p>
                <button className="bg-blue-600 text-white px-4 py-2 rounded-md hover:bg-blue-700">
                  View Cleaned Data
                </button>
              </div>
              
              <div className="bg-green-50 p-4 rounded-lg">
                <h4 className="font-medium text-green-900 mb-2">Batched Data Preview</h4>
                <p className="text-green-700 text-sm mb-3">
                  Preview individual batches to verify section splitting results.
                </p>
                <button className="bg-green-600 text-white px-4 py-2 rounded-md hover:bg-green-700">
                  View Batched Data
                </button>
              </div>
            </div>
          </div>
        )}

        {activeTab === 'statistics' && (
          <div className="space-y-4">
            <h3 className="text-lg font-semibold text-gray-900">Processing Statistics</h3>
            {statistics ? (
              <div className="grid grid-cols-1 md:grid-cols-3 gap-4">
                <div className="bg-blue-50 p-4 rounded-lg text-center">
                  <div className="text-2xl font-bold text-blue-600">
                    {statistics.source_collection?.count || 0}
                  </div>
                  <div className="text-sm text-blue-600">Source Documents</div>
                  <div className="text-xs text-blue-500">{config.source_collection}</div>
                </div>
                
                <div className="bg-green-50 p-4 rounded-lg text-center">
                  <div className="text-2xl font-bold text-green-600">
                    {statistics.cleaned_collection?.count || 0}
                  </div>
                  <div className="text-sm text-green-600">Cleaned Documents</div>
                  <div className="text-xs text-green-500">{config.cleaned_collection}</div>
                </div>
                
                <div className="bg-purple-50 p-4 rounded-lg text-center">
                  <div className="text-2xl font-bold text-purple-600">
                    {statistics.batched_collections?.count || 0}
                  </div>
                  <div className="text-sm text-purple-600">Batch Collections</div>
                  <div className="text-xs text-purple-500">{config.batched_collection}_*</div>
                </div>
              </div>
            ) : (
              <div className="text-center py-8 text-gray-500">
                <Database className="h-12 w-12 mx-auto mb-4 text-gray-400" />
                <p>No statistics available</p>
                <button
                  onClick={fetchStatistics}
                  className="mt-2 bg-blue-600 text-white px-4 py-2 rounded-md hover:bg-blue-700"
                >
                  Load Statistics
                </button>
              </div>
            )}
          </div>
        )}

        {activeTab === 'history' && (
          <div className="space-y-4">
            <h3 className="text-lg font-semibold text-gray-900">Processing History</h3>
            <div className="bg-gray-50 p-4 rounded-lg">
              <p className="text-gray-600 text-sm">
                Processing history and audit trail will be displayed here. This feature tracks all field cleaning and section splitting operations.
              </p>
            </div>
          </div>
        )}
      </div>
    </div>
  );
};

export default Phase3;
